import React from 'react';
import { useNavigate } from 'react-router-dom'; // Hook para navegação
import '.'

const Home = () => {
  const navigate = useNavigate(); // Inicializa o hook de navegação

  return (
    <div className="container d-flex flex-column align-items-center justify-content-center vh-100">
      <h1 className="mb-4 text-center">Portal do Funcionário</h1>
      <div className="d-flex flex-column align-items-center gap-2 w-100">
        <button className="btn btn-primary w-100 max-w-300" onClick={() => navigate('/Login')}>Entrar</button>
        <button className="btn btn-secondary w-100 max-w-300" onClick={() => navigate('/Cadastrar')}>Cadastrar</button>
      </div>
    </div>
  );
};

export default Home;
